INSERT INTO `new` VALUES (67,'https://res.cloudinary.com/dd1grolgr/image/upload/v1710489077/tagged-images/ztnamvnsows28vtngq3n.jpg','admin','2024-01-14 12:13:22','admin','2024-03-21 22:29:50','<p class=\"description\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(252, 250, 246);box-sizing:border-box;color:rgb(34, 34, 34);font-family:arial;font-size:18px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;line-height:28.8px;margin:0px 0px 15px;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-rendering:optimizelegibility;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Phó tổng giám đốc Eximbank nói cán bộ xử lý đã máy móc gửi thông báo tới khách hàng khi chưa được lãnh đạo duyệt, nên ngân hàng \"sẽ không thu khoản nợ 8,8 tỷ\".</p><article class=\"fck_detail \" style=\"-webkit-text-stroke-width:0px;background-color:rgb(252, 250, 246);box-sizing:border-box;color:rgb(34, 34, 34);float:left;font:400 18px / 28.8px arial;letter-spacing:normal;margin:0px;orphans:2;padding:0px;position:relative;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-rendering:optimizelegibility;text-transform:none;white-space:normal;widows:2;width:680px;word-spacing:0px;\"><p class=\"Normal\" style=\"box-sizing:border-box;line-height:28.8px;margin:0px 0px 1em;padding:0px;text-rendering:optimizespeed;\">Thông tin được ông Nguyễn Hồ Hoàng Vũ, Phó tổng giám đốc Ngân hàng Xuất nhập khẩu (Eximbank), nói tại buổi họp báo kinh tế, xã hội TP HCM, chiều 21/3.</p><p class=\"Normal\" style=\"box-sizing:border-box;line-height:28.8px;margin:0px 0px 1em;padding:0px;text-rendering:optimizespeed;\">Theo ông Vũ, chính sách lãi, phí của thẻ tín dụng được ngân hàng xây dựng dựa trên thông lệ thị trường, xét đến yếu tố cạnh tranh và phù hợp nhu cầu của khách hàng.</p><p class=\"Normal\" style=\"box-sizing:border-box;line-height:28.8px;margin:0px 0px 1em;padding:0px;text-rendering:optimizespeed;\">Trong vụ khách hàng <a style=\"border-bottom-style:solid;border-bottom-width:1px;box-sizing:border-box;color:rgb(7, 109, 182);margin:0px;padding:0px 0px 1px;position:relative;text-decoration:none;text-rendering:optimizelegibility;text-underline-position:under;\" href=\"https://vnexpress.net/no-the-tin-dung-gan-9-trieu-thanh-no-xau-hon-8-8-ty-dong-4722234.html\" rel=\"dofollow\" data-itm-source=\"#vn_source=Detail-KinhDoanh_Ebank-4725128&amp;vn_campaign=Box-InternalLink&amp;vn_medium=Link-NoTheTinDung&amp;vn_term=Desktop&amp;vn_thumb=0\" data-itm-added=\"1\">nợ thẻ tín dụng</a> gần 9 triệu thành nợ xấu hơn 8,8 tỷ đồng, ông Vũ cho hay theo quy trình xử lý nợ thẻ quá hạn, cán bộ phụ trách phải căn cứ vào quá trình nợ để đề xuất lãnh đạo mức lãi, phí phù hợp. Mức phí này cần được trình cấp lãnh đạo duyệt, rồi mới gặp hoặc thông báo với khách hàng.</p><p class=\"Normal\" style=\"box-sizing:border-box;line-height:28.8px;margin:0px 0px 1em;padding:0px;text-rendering:optimizespeed;\">\"Tuy nhiên, trường hợp khách hàng Phạm Huy Anh, cán bộ thực hiện đã máy móc chưa làm theo quy trình này\", ông Vũ nói. Eximbank đã làm việc với khách hàng để thống nhất cách xử lý hợp tình và hài hòa lợi ích đôi bên.</p><p class=\"Normal\" style=\"box-sizing:border-box;line-height:28.8px;margin:0px 0px 1em;padding:0px;text-rendering:optimizespeed;\">\"Chắc chắn sẽ không có khoản nợ 8,8 tỷ đồng như vừa qua\", lãnh đạo Eximbank nói, thêm rằng đây là trường hợp cá biệt từ trước đến nay.</p><p class=\"Normal\" style=\"box-sizing:border-box;line-height:28.8px;margin:0px 0px 1em;padding:0px;text-rendering:optimizespeed;\">Trước đó, trong thông cáo báo chí phát ra cách đây một tuần Eximbank khẳng định cách tính lãi, phí là hoàn toàn phù hợp với thỏa thuận giữa họ và khách hàng theo hồ sơ mở thẻ có đầy đủ chữ ký ngày 15/3/2013. Phía ngân hàng cũng cho rằng gần 11 năm qua, đã nhiều lần thông báo và làm việc trực tiếp tuy nhiên \"khách hàng vẫn chưa có phương án xử lý nợ\".</p></article>','sdsdsd','test editor',3,1),(68,'https://res.cloudinary.com/dd1grolgr/image/upload/v1705209500/tagged-images/tazpafqpfnzksdmko5jd.jpg','admin','2024-01-14 12:18:26',NULL,'2024-01-14 12:18:26','Miền Bắc sắp đón không khí lạnh mạnh','Miền Bắc sắp đón không khí lạnh mạnh','Miền Bắc sắp đón không khí lạnh mạnh',4,1),(69,'https://res.cloudinary.com/dd1grolgr/image/upload/v1705209716/tagged-images/lwmd5urrolfxgzkblywi.jpg','admin','2024-01-14 12:22:02',NULL,'2024-01-14 12:22:02','18 vấn đề lớn của dự luật Đất đai sửa đổi đã được thống nhất','18 vấn đề lớn của dự luật Đất đai sửa đổi đã được thống nhất','18 vấn đề lớn của dự luật Đất đai sửa đổi đã được thống nhất',2,1),(70,'https://res.cloudinary.com/dd1grolgr/image/upload/v1710582428/tagged-images/qy3bayno2ooceiyqtq0b.jpg','admin3','2024-01-14 12:24:26','admin3','2024-03-16 16:54:43','Nga lần đầu tập kích kép ở Odessa, 20 người chết','Nga lần đầu tập kích kép ở Odessa, 20 người chết','Nga lần đầu tập kích kép ở Odessa, 20 người chết',3,1),(71,'https://res.cloudinary.com/dd1grolgr/image/upload/v1705211012/tagged-images/bgpr5f2un5h82r4rsaxj.jpg','admin','2024-01-14 12:43:38',NULL,'2024-01-14 12:43:38','Khai mạc Triển lãm Xe điện hóa đầu tiên tại Việt Nam','Khai mạc Triển lãm Xe điện hóa đầu tiên tại Việt Nam','Khai mạc Triển lãm Xe điện hóa đầu tiên tại Việt Nam',5,1),(72,'https://res.cloudinary.com/dd1grolgr/image/upload/v1705211790/tagged-images/s262jnusxcoqic5mhw61.jpg','admin','2024-01-14 12:56:35',NULL,'2024-01-14 12:56:35','Nhiều chặng bay \'cháy\' vé Tết','Nhiều chặng bay \'cháy\' vé Tết','Nhiều chặng bay \'cháy\' vé Tết',4,1),(73,'https://res.cloudinary.com/dd1grolgr/image/upload/v1705211872/tagged-images/n2duzfyetyzscylzvgxg.png','admin','2024-01-14 12:58:04',NULL,'2024-03-06 22:58:13','Giá Bitcoin nhảy múa sau khi quỹ ETF được phê duyệt','Giá Bitcoin nhảy múa sau khi quỹ ET